/*Table structure for table `cy_user` */

DROP TABLE IF EXISTS `cy_user`;

CREATE TABLE `cy_user` (
  `id` int(64) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `username` varchar(50) DEFAULT NULL COMMENT '用户名',
  `password` varchar(50) DEFAULT NULL COMMENT '密码',
  `name` varchar(50) DEFAULT NULL COMMENT '中文名',
  `email` varchar(50) DEFAULT NULL COMMENT '邮箱地址',
  `phone` varchar(20) DEFAULT NULL COMMENT '手机号码',
  `is_enable` tinyint(1) DEFAULT NULL COMMENT '是否可用',
  `login_ip` varchar(20) DEFAULT NULL COMMENT '最后登录IP',
  `operate_date` datetime DEFAULT NULL COMMENT '最后登陆时间',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `creator` varchar(10) NOT NULL DEFAULT 'SYSTEM' COMMENT '创建者',
  `modifier` varchar(10) NOT NULL DEFAULT 'SYSTEM' COMMENT '修改者',
  `extra_info` varchar(128) DEFAULT NULL COMMENT '扩展字段',
  `is_deleted` char(1) NOT NULL DEFAULT 'N' COMMENT '是否删除（Y：是，N：否）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

/*Data for the table `cy_user` */

insert  into `cy_user`(`id`,`username`,`password`,`name`,`email`,`phone`,`is_enable`,`login_ip`,`operate_date`,`create_time`,`update_time`,`creator`,`modifier`,`extra_info`,`is_deleted`) values (1,'admin','8afa5fc58c15526643887d42ab5c9210','超级管理员','1','1',1,NULL,'2017-10-26 14:24:46','0000-00-00 00:00:00','0000-00-00 00:00:00','SYSTEM','SYSTEM',NULL,'N');

